import './App.css';
import { useNavigate } from "react-router-dom";
import React from 'react'

function App() {
  let navigate = useNavigate(); 
  const routeChange = () =>{ 
    let path = `my-app/src/Company.js`; 
    navigate(path);
  }

  return (
    <div className="App">
      <header className="App-header">

        <p>
          This is my website
        </p>
        <Button color="primary" className="px-4"
            onClick={routeChange}
              >
              View Info
            </Button>

      </header>
    </div>
  );
}

export default App;
